	<div>
		{cartItems.map((cartitem) => <CollectionItem cartItems={cartItems} />)}
	</div>
);

const mapStatesToProps = ({ cart: { cartItems } }) => ({ cartItems });

export default connect(mapStatesToProps)(Cart);
